10型 ワイドSVGAモニター HDM-W10は、D1～D4までの映像信号入力に対応した高精細液晶モニター。<br>
D端子出力を持ったAV機器や当社製地上デジタルハイビジョンチューナー HIT7700をD端子で接続すれば、より高精細で鮮明な映像を楽しめるとともに、細かな文字までくっきり表示されますので字幕や番組表などもストレス無く使用することができます。<br>
また、映像増幅回路を搭載したD端子出力を装備しており、本機を最大3台まで数珠つなぎ接続が可能。<br>
映像分配器を使用することなく複雑な配線も不要で、簡単にマルチモニター化を実現できます。<br>
<br>
画面サイズ 10.1インチ ワイド <br>

パネル解像度 WSVGA （1,024×600） <br>

表示可能解像度 1,024×600 
<br>
画素数 1,843,200 
<br>
バックライト LED （エッジライト方式） <br>

